import React from 'react'
import BigButton from '../BigButton'
import LoginFormComponents from './LoginFormComponents'



function LoginComponentsContainer() {


    const cssBtn=`bg-gray-300 px-8 py-4 w-96 mt-5 rounded-xl font-semibold 
                text-3xl uppercase tracking-widest text-gray-100 
                cursor-pointer hover:bg-red-300 duration-500 hover:animate-pulse	`

    const logIn = ()=>{alert('Ingresando')}

    return (
        <div class='flex flex-col items-center justify-center h-screen'>
            <LoginFormComponents/>
            <BigButton onClickFunction={logIn} text={'Ingresar'} cssClass={cssBtn}/>
        </div>
    )
}

export default LoginComponentsContainer
